def calculate_encryption_key(m, n, p=10 ** 9 - 7):
    MAXN = 200005
    f = [0] * MAXN

    def binom(n, r, p):
        if n < 0 or r < 0 or n < r:
            return 0
        if f[0] != 1:
            f[0] = 1
            for i in range(1, MAXN):
                f[i] = i * f[i - 1] % p

        def inv(n):
            return pow(n, 500000001, p)
        ret = 1
        while n or r:
            (n0, r0) = (n % p, r % p)
            (n, r) = (n // p, r // p)
            if n0 < r0:
                return 0
            ret *= f[n0] * inv(f[r0]) * inv(f[n0 - r0])
            ret %= p
        return ret
    x = binom(2 * n, n, p - 1)
    return pow(x, m, p - 1)

